import React from 'react';
import { Container, Typography } from '@mui/material';

const Home = () => {
    return (
        <Container>
            <Typography variant="h2" component="h1" gutterBottom>
                Welcome to Grimoires Guardians
            </Typography>
            <Typography variant="body1">
                Explore and enjoy the world of tabletop RPGs with our platform.
            </Typography>
        </Container>
    );
};

export default Home;
